import * as React from "react";
import { useParams } from "react-router-dom";
import data from "../data.json";

function Instruction(props) {
  const { id } = useParams();

  return (
    <div>
        <div></div>
      Instruction
      <a
        href={`/task/${id}`}
        style={{
          border: "2px solid #e26c40",
          padding: "1%",
          color: "#e26c40",
          borderRadius: "20%",
          textDecoration: "none",
          marginBottom: "2%",
        }}
        id={props.id}
        name="Next"
      >
        Start
      </a>
    </div>
  );
}

export default Instruction;
